import React from 'react';
import Navbar from '../components/Navbar';

const Profile = () => {
  return (
    <div>
      <Navbar />
      <h1>Your Profile</h1>
      <p>Profile details and settings will go here.</p>
    </div>
  );
};

export default Profile;
